import Footer from '../Components/Footer';
import CarouselBigBox from '../Components/CarouselBigBox';
import ColoredBoxSet from '../Components/ColoredBoxSet';
import BigHeading from "../Components/BigHeading"
import {Col, Row} from "react-bootstrap"
import BlackLineTitle from '../Components/BlackLineTitle';

function About(){
    let intro = {
            Title : <small>Dietitian</small>,
            Content: <div><h1><strong>Rashu Malhotra</strong></h1><br></br>
        <small>M.sc  Foods and Nutrition, B.Ed.<br></br>
        (Online Consulation Available)<br></br>
        </small>
    </div>
    };

    let AboutList = [
        {
            _id: 1, Color: "#D7E9F7",
            Title : "SERVICES / DIET PLANS OFFERED",
            Content: <span><Row>
                            <Col sm={4}><li>Healthy Living</li>
                            <li>Weight Loss</li>
                            <li>Weight Gain</li></Col>
                            <Col sm={4}><li>Body Building</li>
                            <li>Therapeutic diets</li>
                            <li>Diabetes</li>
                            <li>Hypertention</li></Col>
                            <Col sm={4}><li>Thyroid</li>
                            <li>Pregnancy</li>
                            <li>Clear skin</li></Col>
                        </Row></span>,

        },{
            _id:2,
            Color: "#D7E9F7",
            Title: "Get detailed and systematic diet charts",
            Content: <i>
                Weekly consultation over the phone <br></br>
                Diet plans @WhatsApp/ SMS/Email.<br></br>
                Pay thru PayTM/Mobiwik/Internet banking/Cash/Cheque
            </i>
        },{
            _id:3, Color: "#D7E9F7",
            Title: "Get detailed and systematic diet charts",
            Content: <i>
                Weekly consultation over the phone <br></br>
                Diet plans @WhatsApp/ SMS/Email.<br></br>
                Pay thru PayTM/Mobiwik/Internet banking/Cash/Cheque
            </i>
        },{
            _id:4, Color: "#D7E9F7",
            Title: "Get detailed and systematic diet charts",
            Content: <i>
                Weekly consultation over the phone <br></br>
                Diet plans @WhatsApp/ SMS/Email.<br></br>
                Pay thru PayTM/Mobiwik/Internet banking/Cash/Cheque
            </i>
        },{
            _id:5, Color: "#D7E9F7",
            Title: "Get It Touch!",
            Content: <sub className='VySmFont'>
                Contact <a href="tel:+91-9910584860" className="SmMdFont NavBarText">+91-9910584860</a><br></br>
                Email <a className="SmMdFont NavBarText" href='mailto:dt.rashumalhotra@gmail.com'>dt.rashumalhotra@gmail.com</a>
            </sub>
        },{
            _id:5, Color: "#D7E9F7",
            Title: "Get It Touch!",
            Content: <sub className='VySmFont'>
                Contact <a href="tel:+91-9910584860" className="SmMdFont NavBarText">+91-9910584860</a><br></br>
                Email <a className="SmMdFont NavBarText" href='mailto:dt.rashumalhotra@gmail.com'>dt.rashumalhotra@gmail.com</a>
            </sub>
        }
    ];

    return(
        <div>
            <BigHeading
                Image="Maam.gif"
                Title={intro.Title}
                Content = {intro.Content}
            />

            <div className='DarkGreenShade' >
            <BlackLineTitle Title="ABOUT"/>
            <div className='container ToCenter'>
                <ColoredBoxSet 
                    AboutList={AboutList}
                />
            </div>
            <div className="LineTextLine" style={{marginBottom:"3%"}}></div>
            </div>

            <CarouselBigBox Title="Succes stories from our lovely clients"/>
            <Footer/>
        </div>
    );
}

export default About;
